package leetcode.competition;

import java.util.HashSet;

public class question2_249 {
    public int countPalindromicSubsequence(String s) {
        HashSet<String> palindromes = new HashSet<>();
        int count = 0;
        HashSet<Character> letters = new HashSet<>();
        for (int i = 0; i < s.length(); i++) {
            if (!letters.contains(s.charAt(i))) letters.add(s.charAt(i));
            else {
                for (int j = s.indexOf(s.charAt(i)) + 1; j < i; j++) {
                    String pal = s.charAt(i) + Character.toString(s.charAt(j));
                    if (!palindromes.contains(pal)) count++;
                    palindromes.add(pal);
                }
            }
        }
        return count;
    }

    public static void main(String[] args) {
        question2_249 q249 = new question2_249();
        System.out.println(q249.countPalindromicSubsequence(""));
        //tle on ^
    }
}